     <label htmlFor="email">Email Address</label>
     <input onChange={inputEvent} type="email" placeholder='name@example.com' name='email' id='email' required/>
    
     <label htmlFor="message">Message</label>
     <textarea onChange={inputEvent}  id="message" cols="30" rows="5" name="message"></textarea>
    
     <button onClick={formSubmit} type='submit' className='contact-btn'>Submit Form</button>
     </form>
    </div>
  )
}

export default Contact
